import React from 'react';
import {NavLink, Router} from 'react-router-dom';

import Home from './Home';
import ContactUs from './ContactUs';
const NavigationBar = () => {
    return(
<div><Router><NavLink value ="Home" type = "button" onClick={Home}>Home</NavLink> 
<NavLink value ="Contact Us" type = "button" onClick={ContactUs}>Contact Us</NavLink></Router></div>
    )

};

export default NavigationBar;
